var Montage = require("montage").Montage,
    Component = require("ui/component").Component;

exports.FeedEntry = Montage.create(Component, {

    _entry: {value: null},
    entry: {
        get: function() {
            return this._entry;
        },
        set: function(value) {
            this._entry = value;            
        }
    }
    
});
